import React, { Component } from 'react';
import ReactPlayer from 'react-player';

export default class VideoQueue extends Component {
	constructor(props){
		super(props);
		this.state ={
			videoArray : ['q','w','e','r','t','y']
		}

	}

	videoList = ({videos}) => {
		const videoComponent = videos.map((user,i) =>{
			return <div>{videos[i]}</div>
		})
	}

	render() {
		return (
			<div>
				<div>{this.videoList}</div>
				<h3>{this.state.videoArray}</h3>
			</div>
		);
	}
}
